snippet.textDisplay:
@Maisla Souza bom dia, Maisla
 Foram.quase 2.000 inscritos no curso. Estamos ainda no período de Avaliaçao que irá até 31 de outubro ( foi prorrogado). Espero gentilmente que aguarde. Caso passe deste período entre em contato conosco. Espero ter ajudado. 
Ana cristina Bispo

